import React, { useEffect } from 'react';
import "./home-page.css";
import { connect } from 'react-redux';
import { getContacts } from '../../redux/actions';

const HomePage = ({ getContacts, contacts }) => {
    useEffect(() => {
        getContacts()
    }, [])
    const handleFormButtonClick = () => {

    }
    console.log(contacts);
    if (contacts)
    // const contactList =
    //     contacts.map((el) =>
    //         <li key={el.id}>

    //         </li>
    //     )
    return (
        <div className="home-page">
            <form className="home-page__el home-page-form">
                <h2 className="home-page-form__heading">Добавить контакт</h2>
                <input
                    className="home-page-form__input"
                    placeholder="Имя"
                    name="name" />
                <input
                    className="home-page-form__input"
                    placeholder="Email"
                    name="email" />
                <input
                    className="home-page-form__input"
                    placeholder="Номер телефона"
                    name="phone" />
                <h3>Тип контакта</h3>
                <label className="home-page-form__label">
                    Личный
                    <input type="radio" name="contact_type" />
                </label>
                <label>
                    Рабочий
                    <input type="radio" name="contact_type" />
                </label>
                <button
                    onClick={handleFormButtonClick}>Добавить контакт</button>
            </form>
            <div className="home-page__el">
                <input
                    placeholder="Фильтр"
                    className="home-page-form__input" />
                <div>У вас пока нет добавленных контактов</div>
            </div>
            <div>
                {/* {contactList} */}
            </div>
        </div>
    );
}

const mapStateToProps = (state) => ({
    contacts: state.contactList
})

export default connect(mapStateToProps, { getContacts })(HomePage);
